// Header.js
import React from 'react';

const Header = ({ handleLoginButtonClick }) => {
  return (
    <div className='headerBar'>
      <button className='adminLoginButton' onClick={handleLoginButtonClick}>
        Admin Login
      </button>
      <button className='loginButton' onClick={handleLoginButtonClick}>
        Customer Login
      </button>
    </div>
  );
};

export default Header;
